p=H.c(["4 pechugas de pollo","Cilantro (una cucharada )","Sal","Ajo","2 tazas de Pan rallado","Mostaza","Pimienta","Aceite para fre\xedr","2 huevos","2 tazas de harina de trigo"],r)
o=H.c(["Mezclar en una taza las 2 tazas de harina, 2 tazas de pan rallado, sal y pimienta al gusto a esto se le a\xf1adir\xe1n los 2 huevos previamente batidos hasta conseguir una mezcla homog\xe9nea.","En una taza a parte sazonar las pechugas de pollo con ajo finamente picado, sal, pimienta, mostaza y cilantro, dejar reposar por 15 minutos en la nevera para que todos los ingredientes se concentren y se adhieran a las pechugas de pollo.","En un sart\xe9n se debe colocar aceite para fre\xedr, pasar las pechugas de pollo por la mezcla homog\xe9nea y cubrir perfectamente todas las pechugas para luego incorporarlas en aceite caliente hasta que se cocinen y queden completamente doradas y crujientes, sacar y dejar secar el aceite en toallas absorbentes.","Estas piezas de pollos pueden acompa\xf1arse perfectamente con una ensalada de tomates, lechuga y cebolla o simplemente con lo que usted guste y tenga a su alcance."],r)
