k=H.c(["En 1 litro de consom\xe9 colocar el pollo cortado en trocitos, de manera opcional puede sofre\xedr los trozos del pollo para a\xf1adir un poco m\xe1s de sabor a la preparaci\xf3n, agregar los ramitos de cilantro, la sal, el tomate, la cebolla y los dientes de ajos cortados en cuadros peque\xf1os y sofritos previamente en aceite, dejar que hierva por 5 minutos, retirar y dejar reposar.","Cortar el aguacate en trocitos colocar encima de la sopa a manera de presentaci\xf3n todo esto junto a las tiras de tortillas, queso rallado, queso crema, decorar el platillo con ramitos de cilantro al gusto y a degustar se ha dicho.","Lo que s\xed es seguro y no se puede negar es que los salvadore\xf1os tienen estilo y saz\xf3n a la hora de preparar este delicioso plato, aprecian y reconocen el intercambio de saberes cuando de cocina se trata y le agregan su \u201ctoque m\xe1gico\u201d a la hora de realizar esta rica receta."],r)
