g=H.c(["Lo recomendable es fre\xedr las piezas de pollo durante aproximadamente 5 minutos por un lado y luego cinco adicionales por el otro. Posteriormente colocarlos en una olla donde verteremos agua hasta cubrir los muslos. Luego se debe cocinarlos.","Tenemos que esperar que hierva, se tapa y se cocina a fuego lento durante una hora. En otro lugar, en un recipiente vaciamos la harina y la levadura. A\xf1adimos la sal y revolvemos. Se agrega el agua y un poco de aceite. Luego se amasa hasta que no queden residuos en nuestras manos y se deja reposar por una hora aproximadamente.","Al terminar la preparaci\xf3n del pollo, retiramos la carne de los huesos y trituramos bien. Luego se pican los pimentones y las cebollas para luego sofre\xedr. Cuando est\xe9n dorados se le a\xf1ada el pollo.","Para continuar, se hacen bolitas de masa y se forma la tortilla. El tama\xf1o de la tortilla depender\xe1 del gusto. Lo recomendable es dejar medio cent\xedmetro de grosor y cocinar a fuego lento.","Una vez lista la tortilla, picamos el queso mozarela y lo a\xf1adimos a la mezcla del pollo. Todos estos ingredientes se ponen en el centro de la tortilla. Se cubre la mezcla al doblar la tortilla y se vuelve a dar forma de circulo.","Finalmente, se debe colocar en la plancha o comal y esperar de 5 a 8 a minutos."],r)
